import {weatherUrl} from '../../api/api'

const setDataWeather = (items) => ({ type: 'SET_DATA_WEATHER', payload: items })

export const getDataWeather = () => async (dispatch) => {
    const resp = await weatherUrl()
    console.log(resp.data)
}
